import React from 'react';
import ReactDOM from 'react-dom';
import App from './containers/App';
import 'tachyons';

const myCats = document.getElementById('root');
document.body.appendChild(myCats);
ReactDOM.render(<App />, myCats)
setInterval(() => {
    ReactDOM.render(<App />, myCats);
}, 1000);

